import React from 'react';

const LowQuantityItems = ({ products }) => {
  // Filter the products with remaining quantity less than 5
  const lowQuantityProducts = products.filter(product => product.rquantity < 5);

  return (
    <div className="low-quantity-items">
      <h2>Items with Remaining Quantity Less Than 5:</h2>
      <ul>
        {lowQuantityProducts.map(product => (
          <li key={product._id}>{product.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default LowQuantityItems;
